import React from 'react';
// import './App.css';
import { BrowserRouter , Route , Routes} from 'react-router-dom';
import Home from "./home";
import About from "./about";


const Nav = () =>{
  return (
    <BrowserRouter>
    <div>
      <a href="/"> home </a>
      <a href="/about"> about</a>
    </div>

    <Routes>
      <Route path="/" element={< Home />} />
      <Route path="/about" element={< About />} />
    </Routes>
    </BrowserRouter>

  );
}

export default Nav;
